const quizData = [
    {
      type: "Multiple-Choice Questions",
      questions: [
        {
          question: "1.Which planet is closest to the Sun?",
          options: ["Venus", "Mercury", "Earth", "Mars"],
          correctAnswer: "Mercury",
        },
        {
          question: "2.Which data structure organizes items in a First-In, First-Out (FIFO) manner?",
          options: ["Stack", "Queue", "Tree", "Graph"],
          correctAnswer: "Queue",
        },
        {
          question: "3. Which of the following is primarily used for structuring web pages?",
          options: ["Python", "Java", "HTML", "C++"],
          correctAnswer: "HTML",
        },
        {
          question: "4.Which chemical symbol stands for Gold?",
          options: ["Au", "Gd", "Ag", "Pt"],
          correctAnswer: "Au",
        },
        {
          question: "5.Which of these processes is not typically involved in refining petroleum?",
          options: ["Fractional distillation", "Cracking", "Polymerization", "Filtration"],
          correctAnswer: "Filtration",
        },
      ],
    },
    {
      type: "Integer-Type Questions",
      questions: [
        {
          question: "1.What is the value of 12 + 28?",
          correctAnswer: "40",
        },
        {
          question: "2.How many states are there in the United States?",
          correctAnswer: "50",
        },
        {
          question: "3.In which year was the Declaration of Independence signed?",
          correctAnswer: "1776",
        },
        {
          question: "4.What is the value of pi rounded to the nearest integer?",
          correctAnswer: "3",
        },
        {
          question: "5.If a car travels at 60 mph for 2 hours, how many miles does it travel?",
          correctAnswer: "120",
        },
      ],
    },
  ];
  
  export default quizData;
